import React from "react";

// Otimize o código do slide anterior
// Utilizando a array abaixo para mostrar
// cada checkbox na tela.


const coresArray = ['azul', 'roxo', 'laranja', 'verde', 'vermelho', 'cinza'];

function App() {

  return (
    <div>
      {coresArray.map((cor) => (
        <label key={cor}>
          <input type="radio" name={cor} id="">
            {cor}
          </input>
        </label>
      ) )}
    </div>
  );
}

export default App;
